using System;
using System.Globalization;
using System.Text;

const string Input = @"";

var isOppositePolarity = (char a, char b) => Math.Abs(a - b) == 32;

var reactPolymers = (string input) =>
{
    var chars = input.ToCharArray().ToList();
    var reacted = true;

    while (reacted)
    {
        reacted = false;
        for (var i = 0; i < chars.Count; i++)
        {
            if (i < chars.Count - 1 && isOppositePolarity(chars[i], chars[i + 1]))
            {
                reacted = true;
                chars.RemoveAt(i);
                chars.RemoveAt(i);
            }
        }
    }

    return new string(chars.ToArray());
};

var polymerized = reactPolymers(Input);
var minLength = polymerized.Length;
Console.WriteLine("Part 1: {0}", minLength);

for (var c = 'a'; c <= 'z'; c++)
{
    var polymerizedWithoutC = reactPolymers(polymerized.Replace(c.ToString(), "", true, CultureInfo.InvariantCulture));
    if (polymerizedWithoutC.Length < minLength) {
        minLength = polymerizedWithoutC.Length;
    }
}

Console.WriteLine("Part 2: {0}", minLength);
